exclude(tree, excludeRegExp) {
	const regExpList = excludeRegExp.map((re) => new RegExp(re));

	function regExpFilter(id) {
		return regExpList.findIndex((regexp) => regexp.test(id)) < 0;
	}

	return Object
		.keys(tree)
		.filter(regExpFilter)
		.reduce((acc, id) => {
			acc[id] = tree[id].filter(regExpFilter);
			return acc;
		}, {});
}
